import React, { useEffect, useState }  from "react";

import styles from './Payment.module.css';

const Payment = (props) =>{

    return( 
            <React.Fragment>
                <div className={`${styles.container}`}> 
                    <ul className={`${styles.ul}`}>
                        <li><input className={`${styles.input}`}></input></li>
                        <li>
                            <label>Date from</label>
                            <input className={`${styles.input}`} type="date" id="datefrom" name="datefrom"></input>
                        </li>
                        <li>
                            <label>Date from</label>
                            <input className={`${styles.input}`} type="date" id="dateto" name="dateto"></input>
                        </li>
                    </ul>
                </div>
            </React.Fragment>
            )
}

export default Payment;
